BA005	bank sampah budi luhur raih juara umum dan rekor indonesia award memilah sampah	http://localhost/bsbl/public/assets/images/thumbnail-berita/61acd0b3a1308.jpeg	<p><strong>Jakarta –</strong> Universitas Budi Luhur hari ini mendapatkan hadiah 1 unit mobil box atas prestasinya meraih juara umum dari Pegadaian dengan tema “Memilah Sampah Menabung Emas” pada Kamis, 23 September 2021.</p><p><br></p><p>Penyerahan hadiah tersebut dari Pemimpin Wilayah IX Jakarta 2 PT Pegadaian, Hakim Setiawan diberikan ke Rektor Universitas Budi Luhur, Dr. Ir. Wendi Usino, MM, M.Sc dan Koordinator Bank Sampah Budi Luhur, Umi Tutik Asmawi. Penyerahan hadiah itu dilaksanakan di Taman Kupu-Kupu Budi Luhur dengan protokol kesehatan dan jaga jarak.</p><p>Rektor Universitas Budi Luhur, Dr. Ir. Wendi Usino, MM, M.Sc mengucapkan kebanggaan terhadap Bank Sampah Budi Luhur dan berkomitmen untuk terus meningkatkan kepedulian lingkungan yang tujuan akhirnya adalah lingkungan terjaga dan memberi kenyamanan masyarakat.</p><p><br></p><p>“Pagi ini kami menerima hadiah dari pegadaian. Kami mengucapkan terima kasih atas lomba karena lomba ini bermanfaat bagi masyarakat. Universitas Budi Luhur mengutamakan kepedulian lingkungan dan peduli masyarakat. Universitas Budi Luhur sangat aktif dengan dukungan Pegadaian merupakan salah satu dan konsentrasi dalam kegiatan-kegiatan ini upaya kita ke tingkat internasional,” ujar Dr. Wendi.</p><p><br></p><p>“Bahkan Bank Sampah mendapatkan rekor mengajak masyarakat membuat karpet sampah plastik, sudah mendapatkan rekor nasional dan muri untuk jumlah dan luas lebih 100 meter persegi,” tambahnya.</p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p>Pemimpin Wilayah IX Jakarta 2 PT Pegadaian, Hakim Setiawan mengapresiasi capian Bank Sampah Budi Luhur yang berhasil meraih juara umum dan memecahkan rekor membuat karpet dari bahan sampah plastik.</p><p>“Program ini dari Pegadaian pusat lomba memilah sampah yang berlangsung 3 tahun terakhir dan manfaatnya sangat besar dan ini kita akan menambah pihak melakukan pembinaan baik bank sampah dan banyak lembaga menangani kegiatan ini. Karena kita membantu pemerintah mengurangi sampah dan meningkatkan lingkungan sesuai dengan visi Universitas Budi Luhur. Dan sampah kalau kita buang begitu saja kita rugi, sampah yang menghasilkan seperti Universitas Budi Luhur sudah memecahkan rekor membuat karpet dari sampah dan memiliki nilai jual itu sangat luar biasa kalau dijual,” jelasnya.</p><p><br></p><p>Koordinator Bank Sampah Budi Luhur, Umi Tutik Asmawi, menjelaskan cara mendapatkan bantuan dari CSR, memenangkan lomba juara nasional dan memecahkan rekor pilah sampah. Menurutnya, kegiatan lingkungan dan masyarakat harus dengan melakukan inovasi modern.</p><p>“Kita banyak mitra-mitra, banyak orang mendapatkan proposal untuk CSR tapi khususnya kami di relawan Bank Budi Luhur, kita berkaitan dengan inovasi makanya CSR yang mendatangi kita. Kita membuat inovasi untuk masyarakat dan lingkungan tanpa kita minta akan ada. Kita ada pendampingan, setiap hari kita melayani ke masyarakat lingkungan,” katanya.</p><p><br></p><p><img src="data:image/jpeg;base64,"></p><p><br></p><p>Bank Sampah Budi Luhur berhasil meraih 3 kategori juara lomba Memilah Sampah Menabung Emas Tahun 2021, yaitu juara 1 untuk kategori akumulasi sampah terbanyak, juara 1 untuk kategori akumulasi saldo tabungan emas tertinggi dan juara 3 untuk kategori akumulasi jumlah partisipan terbanyak. Atas ketiga juara tersebut Bank Sampah Budi Luhur dinobatkan juara umum dan mendapatkan 1 unit mobil box.</p><p>Universitas Budi Luhur juga meraih penghargaan dalam acara World Clean Up Day 2021 berhasil memecahkan rekor gerakan pilah sampah dari rumah dan peserta terbanyak se-Indonesia. Penghargaan tersebut diberikan di gedung Walikota Jakarta Selatan pada 18 September 2021.</p>	KB03	A001	1638781305	bank-sampah-budi-luhur-raih-juara-umum-dan-rekor-indonesia-award-memilah-sampah
BA004	ternyata, universitas budi luhur punya bank sampah, sarana sosialisasi dan peduli lingkungan	http://localhost/bsbl/public/assets/images/thumbnail-berita/61accec36a7c1.jpeg	<p><strong>JAKARTA, KalderaNews.com</strong> – Universitas Budi Luhur (UBL) ternyata memiliki bank sampah yang dijadikan sebagai sarana pengabdian kepada masyarakat. Dan baru-baru ini, bank sampah karya UBL ini meraih 3 gelar sekaligus dalam lomba yang diadakan Pegadaian.</p><p>Rektor Universitas Budi Luhur, Dr. Ir. Wendi Usino, M.Sc mengatakan, Bank Sampah Budi Luhur merupakan wadah pengelolaan sampah dan menjadi tempat sosialisasi dengan masyarakat. Ini juga menjadi wujud kepedulian Universitas Budi Luhur terhadap lingkungan hidup.</p><p><br></p><p><strong><em>BACA JUGA:</em></strong></p><ul><li><a href="https://www.kalderanews.com/2021/08/ada-beasiswa-ppkm-universitas-budi-luhur-lho-gratis-kuliah-sampai-lulus-untuk-150-calon-mahasiswa/" target="_blank"><strong><em>Ada Beasiswa PPKM Universitas Budi Luhur Lho, Gratis Kuliah Sampai Lulus untuk 150 Calon Mahasiswa</em></strong></a></li><li><a href="https://www.kalderanews.com/2021/07/universitas-budi-luhur-ubl-bagikan-paket-isoman-untuk-warga-sekitar-kampus/" target="_blank"><strong><em>Universitas Budi Luhur (UBL) Bagikan Paket Isoman untuk Warga Sekitar Kampus</em></strong></a></li><li><a href="https://www.kalderanews.com/2021/06/menteri-sandi-dan-najwa-shihab-bakar-semangat-lulusan-universitas-budi-luhur/" target="_blank"><strong><em>Menteri Sandi dan Najwa Shihab Bakar Semangat Lulusan Universitas Budi Luhur</em></strong></a></li></ul><p><br></p><p>“Puji syukur kepada Tuhan, Bank Sampah Budi Luhur dinyatakan sebagai Juara Umum Lomba Memilah Sampah Menabung Emas 2021 dan meraih hadiah Mobil Box. Selamat kepada Bank Sampah Budi Luhur, dengan kerja keras, kerja cerdas, kerja ikhlas, dan kerja tuntas berhasil meraih prestasi yang berkualitas. Tetap semangat berkarya dan tidak cepat merasa puas,” ujar Dr. Wendi.</p><p>Bank Sampah Budi Luhur berhasil meraih 3 kategori juara lomba Memilah Sampah Menabung Emas Tahun 2021, yaitu juara 1 untuk kategori akumulasi sampah terbanyak, juara 1 untuk kategori akumulasi saldo tabungan emas tertinggi, dan juara 3 untuk kategori akumulasi jumlah partisipan terbanyak. Atas ketiga juara tersebut Bank Sampah Budi Luhur dinobatkan juara umum dan mendapatkan 1 unit mobil box.</p><p class="ql-align-center"><br></p><p>Koordinator Bank Sampah Budi Luhur, Umi Tutik menjelaskan, pihaknya memang selalu fokus pada kegiatan lingkungan dan memberi edukasi kepada masyarakat terkait pengelolaan sampah. Ia mengatakan, prestasi yang diraih Bank Sampah ini merupakan pencapaian yang didukung oleh berbagai pihak.</p><p>Bank Sampah Budi Luhur berperan sebagai social engineering masyarakat internal dan ekstrnal kampus dalam pengelolaan sampah. Kegiatan Bank Sampah Budi Luhur melakukan kegiatan “operasi semut dan gajah”, mengedukasi pemilahan sampah yang dilakukan oleh relawan mahasiswa dan rutin berkegiatan setiap Minggu pukul 09:00 – 17:00 WIB.</p><p>Bank Sampah Budi Luhur lahir pada 11 April 2017. Bank sampah ini telah berhasil melakukan daur ulang sampah menjadi produk layak jual, seperti tas, dompet, dan yang lain. Hal ini juga mendukung industri kreatif masyarakat.</p><p><br></p><blockquote><strong><em>*Jika merasa artikel ini bermanfaat, silakan dishare pada saudara, sahabat dan teman-temanmu.</em></strong></blockquote>	KB03	A001	1638781400	ternyata,-universitas-budi-luhur-punya-bank-sampah,-sarana-sosialisasi-dan-peduli-lingkungan
BA002	webinar dan soft launching “dipo waste bank”	http://localhost/bsbl/public/assets/images/thumbnail-berita/61acccff3b664.jpeg	<p>Kontribusi Bank Sampah Kampus dalam Mendukung Implementasi SDGs</p><p><strong>Pendahuluan</strong></p><p class="ql-align-justify">Masalah sampah telah menjadi problematika yang cukup memprihatinkan dalam kehidupan masyarakat, terutama sampah plastik, kertas, dan logam. Bahan plastik telah dipahami oleh masyarakat luas sebagai bahan yang tidak mudah terurai di alam baik oleh tanah, air, maupun udara. Namun, keberadaan plastik tidak bisa dinafikan begitu saja karena diperlukan oleh manusia untuk mempermudah kehidupan. Selain plastik, sampah kertas juga cukup banyak dihasilkan yang membawa konsekuensi besar atas cepat berkurangya pepohonan di hutan-hutan yang menjadi bahan baku kertas. Oleh karena itu, perlu aksi lebih lanjut untuk mengolah sampah/limbah plastik dan kertas secara efektif, efisien, dan berkesinambungan, agar kelestarian lingkungan terjaga.</p><p class="ql-align-justify">Langkah 3R “<em>Reuse-Reduce-Recycle</em>” bisa dilakukan oleh siapapun. Khusus untuk <em>recycle </em>(dan <em>upcycle</em>) memerlukan sumber daya yang besar yang tidak semua orang mau dan mampu melakukannya. Namun, semua orang bisa mendukung tercapainya <em>recycle </em>dan <em>upcycle </em>ini dengan turut mengumpulkan sampah plastik dan kertas dan menunda waktu pembuangan hingga terkumpul volume sampah yang cukup besar. Sampah yang terkumpul tersebut bisa ditukar dengan nominal rupiah karena sampah yang terkumpul akan dijadikan bahan baku benda baru hasil olahan sampah plastik dan kertas. Proses pengumpulan sampah yang akan dijual itu bisa dikelola dengan sistem menyerupai “bank” atau “koperasi”. Sistem inilah yang diadopsi untuk mengatur pengumpulan sampah yang memberdayakan komunitas, yang dikenal dengan istilah “Bank Sampah”.</p><p class="ql-align-justify"><br></p><p class="ql-align-justify"><img src="data:image/jpeg;base64," style="display: block; margin: auto;"></p><p class="ql-align-justify"><br></p><p class="ql-align-justify">Pemberdayaan komunitas yang memberi efek domino pada beragam kelompok masyarakat menjadi salah satu tujuan pencapaian Sustainable Development Goals (SDGs). Pencapaian SDGs menjadi tugas bersama antara Pemerintah, Kelompok Masyarakat, Akademisi, Pihak Swasta, Lembaga Non-Pemerintah/Non-Swasta, dan Media. Setiap pihak yang terkait dengan penanganan masalah yang masuk dalam tujuh belas tujuan SDGs harus terlibat dengan peran penting masing-masing. “Bank Sampah” bisa diselenggarakan oleh kelompok atau komunitas masyarakat manapun dan kapanpun. Pihak akademisi (kampus) juga bisa menyelenggarakan bank sampah untuk menggerakkan kesadaran warga kampus dalam pengelolaan sampah. Dengan inisiasi gagasan dari tim penelitian Dosen dan Mahasiswa Teknik Lingkungan, keberadaan sistem “Bank Sampah” menjadi salah satu solusi yang bisa memberi efek domino pemberdayaan komunitas sekaligus menjadi cara edukasi kepada warga kampus Undip untuk mengambil langkah bijak terkait sampah anorganik seperti plastik dan kertas.</p><p>&nbsp;</p><p><strong>Tujuan Kegiatan</strong></p><p>Penyelenggaraan Bank Sampah di lingkungan Universitas Diponegoro bertujuan untuk:</p><p>1). Mempromosikan pengelolaan sampah yang bertanggung jawab;</p><p>2). Mengumpulkan sampah yang masih bisa ditingkatkan nilainya;</p><p>3). Mengedukasi warga kampus pentingnya mengurangi volume sampah yang dihasilkan dari kegiatan sehari-hari, agar tercapai <em>zero waste</em>.</p><p>&nbsp;</p><p><strong>Pelaksanaan Kegiatan</strong></p><p>Webinar yang akan diselenggarakan dapat digunakan sebagai media sosialisasi dan promosi bank sampah akan dilakukan pada <strong>Sabtu, 5 Juni 2021 pukul 10.00-11.30 WIB</strong> dengan susunan acara berikut:</p><p><br></p><p>Setelah pelaksanaan webinar, akan dilaksanakan pengumpulan sampah secara <em>drive through </em>pada hari Kamis, 24 Juni 2021 pukul 10.00-13.00 WIB di Parkiran Dekanat Lama Fakultas Teknik UNDIP.</p><p>&nbsp;</p><p><strong>Penutup</strong></p><p>Demikian term of reference ini dibuat untuk dapat dijadikan acuan demi kelancaran acara ini</p><p><br></p><p>link terkait:</p><p><a href="https://sustainability.undip.ac.id/2021/06/08/webinar-dan-soft-launching-dipo-waste-bank/" target="_blank">https://sustainability.undip.ac.id/2021/06/08/webinar-dan-soft-launching-dipo-waste-bank/</a></p>	KB01	A001	1638781402	webinar-dan-soft-launching-“dipo-waste-bank”
BA001	bank sampah budi luhur menjadi referensi studi banding kkn mahasiswa ipb university	http://localhost/bsbl/public/assets/images/thumbnail-berita/61a45114cb19d.jpeg	<p>Jakarta, 12 Juli 2020 Bank Sampah (BS) Budi Luhur (BL) kedatangan mahasiswa KKN IPB University dalam rangka studi banding yang berkenaan dengan tugas KKN IPB yakni “Proses Pendirian Bank Sampah” yang dilaksanakan pada Juli – Agustus. Dalam kunjungannya ini dilakukan sharing pengalaman dan pembelajaran tentang bersahabat dengan lingkungan untuk bekal kegiatan masyarakat dalam rangka melaksanakan tugas KKN nantinya. Ketika ditanya mengapa memilih study banding ke BS BL, perwakilan dari tim KKN IPB University mengakatakan bahwa bank sampah Budi Luhur berbeda pada umumnya.</p><p><br></p><p><img src="data:image/jpeg;base64," style="display: block; margin: auto;" width="441"></p><p><br></p><p>“Karena program dan kegiatan Bank Sampah Budi Luhur sangat berbeda&nbsp;dengan bank sampah pada umumnya” Jelas Amira Amandanisa dari Departemen Biokimia Fakultas Matematika dan Ilmu Pengetahuan Alam IPB University.</p><p>Kegiatan yang dilakukan saat studi banding ini di antaranya yakni melihat Fasilitas Bank Sampah di kampus Budi Luhur, lalu ke tempat pemilihan dan pengolahan – pencacahan (botol gelas plastik) dan sampah yang mempunyai nilai jual, kemudian ke bank sampah yang berada di belakang, selanjutya memperlihatkan fasilitas yang disediakan Universitas Budi Luhur untuk kunjungan masyarakat hingga menuju ke Galeri BS BL dan stay di Kliinik Daur Ulang Bank Sampah Budi Luhur.</p><p><br></p><p><img src="data:image/jpeg;base64," style="display: block; margin: auto;" width="451"></p><p><br></p><p>Tim KKN IPB belajar dan praktek langsung bagaimana membuat kreasi daur ulang dari kemasan sachet plastik serta klaras (tulang daun) hingga karyanya jadi dari pkl 10:00 – 16:00 WIB di Klinik Daur Ulang Bank Sampah. Karya yang telah jadi dibawa pulang sebagai bentuk oleh-oleh dan kenang-kenangan dari Bank Sampah Budi Luhur. Selagi membuat karya kreasi daur ulang Tim KKN IPB mengatakan bahwa program yang ada di&nbsp;Bank Sampah&nbsp;Budi Luhur bagus.</p><p><br></p><p><img src="data:image/jpeg;base64," style="display: block; margin: auto;" width="461"></p><p><span class="ql-cursor">﻿﻿</span></p><p>Hj. Tutik Sri Susilowati biasa dipanggil Umi Tutik selaku Koordinator Bank Sampah Budi Luhur menegaskan bahwa ini merupakan salah satu cara untuk merealisasikan seperti apa sifat berbudi luhur itu. “Universitas Budi Luhur bukan hanya sekedar nama, Bank Sampah Budi Luhur salah satu wadah kegiatan belajar bersama mengenai sifat keluhuran budi dan langsung bisa merealisasikan dengan kegiatan nyata seperti apa berbudi luhur itu secara natural sesuai potensi diri dan cara masing-masing untuk sesama dan lingkungan.” Tuturnya.</p>	KB02	A001	1638781428	bank-sampah-budi-luhur-menjadi-referensi-studi-banding-kkn-mahasiswa-ipb-university
BA003	kolaborasi universitas budi luhur dan pt pegadaian wujudkan ruang kreatif dan wisata edukasi daur ulang bank sampah budi luhur	http://localhost/bsbl/public/assets/images/thumbnail-berita/61a45385756a7.jpeg	<p>PT. Pegadaian (Persero) telah meresmikan pembukaan The Gade Creative Lounge dan Bank Sampah Budi Luhur pada hari Kamis, 31 Maret 2021 di Universitas Budi Luhur Jakarta. Peresmian ini dihadiri oleh Rektor Universitas Budi Luhur Bapak Dr.Ir. Wendi Usino, M.Sc., M.M. ; Ketua Yayasan Pendidikan Budi Luhur Cakti, Bapak Kasih Hanggoro, MBA serta Bapak Dr. Damar Latri Setiawan selaku Direktur Jaringan, Operasi, dan Penjualan PT Pegadaian didampingi bersama Asisten Deputi Tanggung Jawab Sosial Lingkungan Kementerian BUMN, Bapak Agus Suharyono.</p><p><br></p><p><img src="data:image/jpeg;base64," style="display: block; margin: auto;" width="448"></p><p><br></p><p>Peresmian The Gade Creative Lounge dan Bank Sampah Budi Luhur ditandai dengan penandatanganan prasasti oleh Bapak Dr. Damar Latri Setiawan dan Bapak Dr.Ir. Wendi Usino, M.Sc., M.M. didampingi oleh Bapak Agus Suharyono dan Bapak Kasih Hanggoro, MBA. Peresmian ini salah satu implementasi kerja sama Universitas Budi Luhur dan PT. Pegadaian (Persero) sejak tahun 2019.</p><p><br></p><p><img src="data:image/jpeg;base64," style="display: block; margin: auto;" width="444"></p><p><br></p><p>Universitas Budi Luhur menerima hibah pembangunan The Gade Creative Lounge ini sebagai salah satu wujud kepedulian PT. Pegadaian (Persero) untuk menuangkan kreativitas mahasiswa dalam berbagai bidang dengan nuansa millennials, khususnya dalam masa pandemic Covid-19.</p><p><br></p><p><img src="data:image/jpeg;base64," style="display: block; margin: auto;" width="439"></p><p><br></p><p>Tumbuhnya kreativitas mahasiswa merupakan bagian dari membangun SDM juga termasuk tujuan BUMN yang secara konsisten membangun anak-anak bangsa.</p><p><br></p><p><img src="data:image/jpeg;base64," style="display: block; margin: auto;" width="438"></p><p><br></p><p>Sedangkan, pemberian hibah renovasi Bank Sampah Budi Luhur kepada Universitas Budi Luhur sebagai wujud kepedulian dan CSR PT. Pegadaian (Persero) terhadap lingkungan hidup khususnya pengelolaan sampah sesuai dengan sustainable development goals.</p><p><br></p><p><img src="data:image/jpeg;base64," style="display: block; margin: auto;" width="437"></p><p><span class="ql-cursor">﻿﻿</span></p><p>Direktur Jaringan, Operasi dan Penjualan PT. Pegadaian (Persero) menyampaikan alasan pemilihan Universitas Budi Luhur karena selama ini diketahui bahwa Universitas Budi Luhur telah memiliki pengelolaan sampah secara organik dan anorganik sejak 8 tahun yang lalu dan telah memiliki nama besar. Ini dibuktikan dengan Bank Sampah Budi Luhur mendapat penghargaan dari Gubernur DKI Jakarta karena Bank Sampah Budi Luhur secara konsisten melakukan pemilahan sampahSelain itu, PT Pegadaian memberikan apresiasi setinggi-tingginya terhadap Bank Sampah Budi Luhur sebagai lembaga pengelolaan sampah dengan kualitas Grade A, sehingga menjadi Bank Sampah percontohan di Indonesia dan menjadikan Bank Sampah Budi Luhur sebagai wisata edukasi daur ulang.</p><p>&nbsp;</p><p>Pada kesempatan ini pula dilakukan peninjauan ke Bank Sampah Budi Luhur yang mendemokan proses pengolahan sampah. Kegiatan akhir dalam acara hari ini adalah diadakannya webinar dengan judul Gue Millennials Melek Financials yang diikuti sekitar 1029 peserta mahasiswa Universitas Budi Luhur.</p><p>Rektor Universitas Budi Luhur Dr. Ir. Wendi Usino, M.Sc., MM. menyampaikan terima kasih dan penghargaan bagi PT. Pegadaian atas bantuan dan kerja sama selama ini yang sangat bermanfaat bagi mahasiswa, dosen maupun para masyarakat sekitar untuk mengelola sampah secara baik, ” Kolaborasi antara Universitas Budi luhur dan Pegadaian terhadap Bank Sampah Budi Luhur sehingga menjadikan wisata edukasi daur ulang yang diharapakan dapat bermanfaat bagi masyarakat di lingkungan hidup” Ungkap Rektor Universitas Budi Luhur.</p><p>Universitas Budi Luhur telah mencatatkan prestasi positif terkait pengelolaan sampah dilingkungan masyarakat serta menjadi motivator dalam hal pengelolaan di lingkungan perguruan tinggi. Hal ini sebagai bentuk konsistensi kampus dalam mendorong kepedulian masyarakat terhadap lingkungan hidup.</p>	KB03	A001	1638781433	kolaborasi-universitas-budi-luhur-dan-pt-pegadaian-wujudkan-ruang-kreatif-dan-wisata-edukasi-daur-ulang-bank-sampah-budi-luhur
